import React from 'react';
import { Link } from 'react-router-dom';


const Header = () => {
    return (
    <React.Fragment>
        <div className='weatherApp'>
        <span className='title'>Weather App</span>
        <span><Link className ='button' to="/">Home</Link> </span>

        </div>

    </React.Fragment>
    )
};

export default Header;
